import './DefectAnalytics.css';
import React, { useState } from "react";
import classNames from "classnames";
import {
    Button,
    ButtonGroup,
    Row,
    Col,
  } from "reactstrap";




import ProgressBar1 from './subviews/ProgressBar1/ProgressBar1';
import ProgressBar2 from './subviews/ProgressBar2/ProgressBar2';
import Chart1 from './subviews/Chart1/Chart1';
import HorizontalBarChart from './subviews/HorizontalBarChart/HorizontalbarChart';
import HorizontalBarChart2 from './subviews/HorizontalBarChart2/HorizontalbarChart2';


function DefectAnalytics() {
  const [ProductionLineState, SetProductionLineState] = React.useState("All");
  const [DefectState, SetDefectState] = React.useState("All");

  const [LineChart_Defect_Example1, LineChart_Defect] = React.useState("HourlyData");
  const set_Main_LineChart_Defect = (name) => {
  LineChart_Defect(name);
};
    return(
        <>        <div style={{position:"relative",left:"0px", top:"-15px", height:"0"}}>
                  <div style={{position:"relative",left:"910px", top:"54px", height:"31.5px"}}>
                    <dropdown>
                      <select onChange={(e) => {
                        const SelectedProductionLine = e.target.value;
                        SetProductionLineState(SelectedProductionLine);

                      }}>
                        <option value="All">Production Line: All</option>
                        <option value="1">Production Line: 1</option>
                        <option value="2">Production Line: 2</option>

                      </select>
                    </dropdown>
                  </div>
                  <div style={{position:"absolute",left:"660px", top:"54px", height:"31.5px"}}>
                    <dropdown>
                      <select onChange={(e) => {
                        const SelectedDefectState = e.target.value;
                        SetDefectState(SelectedDefectState);

                      }}>
                        <option value="All">Defect: All</option>
                        <option value="SSCT">Defect: SSCT</option>
                        <option value="POGR">Defect: POGR</option>
                        <option value="POCK">Defect: POCK</option>
                        <option value="STANSTONE">Defect: STANSTONE</option>
                        <option value="STANWHITE">Defect: STANWHITE</option>
                      </select>
                    </dropdown>
                  </div>
                  </div>
            <div class="content">


                <ButtonGroup style={{top:"-70.5px", left:"28px", position:"relative", width:"228px"}}
                className="btn-group-toggle float-right"
                data-toggle="buttons"
                >

                    <Button
                     tag="label"
                     className={classNames("btn-simple", {
                     active:  LineChart_Defect_Example1 === "HourlyData" 
                     })}
                     color="info"
                     id="0"
                     size="sm"
                     onClick={() => {set_Main_LineChart_Defect("HourlyData");
                     }}
                     >
                        <span className="d-none d-sm-block d-md-block d-lg-block d-xl-block">
                        Hourly
                        </span>

                    </Button>       

                    <Button
                     tag="label"
                     className={classNames("btn-simple", {
                     active: LineChart_Defect_Example1 === "DailyData" 
                     })}
                     color="info"
                     id="0"
                     size="sm"
                     onClick={() => {"" 
                     }}
                     >
                        <span className="d-none d-sm-block d-md-block d-lg-block d-xl-block">
                        Daily
                        </span>

                    </Button>     


                    <Button
                     tag="label"
                     className={classNames("btn-simple", {
                     active: ""
                     })}
                     color="info"
                     id="0"
                     size="sm"
                     onClick={() => {"" 
                     }}
                     >
                        <span className="d-none d-sm-block d-md-block d-lg-block d-xl-block">
                        Monthly
                        </span>

                    </Button>     



                </ButtonGroup>
                <Col style={{display:"inline-block"}}>
                <Row >



                <HorizontalBarChart DefectState={DefectState} ProductionLineState={ProductionLineState} />
                </Row>
                </Col>

                <Row className="card-view">

                <Chart1 />
                </Row>
            </div>
        </>
    )

};

export default DefectAnalytics;
